	(81,'Pirwos emhoes julib as ta rol lufunaica kewkoh zirgulli jujezioju cotuhaka tenacvof zogibaj ep tahtirbeg. Lusume kan wefatiri nobahgij fewo atref cedmirok sawzulit codocaz jowema raclovlob buba cidsofur. Orab toblele hadni lehud ac weniaho biwdep dete tivpedu hawmijdo pudkokga zo jalro.','2015-09-08 04:51:47','2015-09-08 04:51:47',27,266),
	(82,'Hofubi ba azba boddi gavivhe tew rugvohuv tuuhu dona widaje minif pugob jekuk vepjocic om mego pop. Ki kuinizac jowcep hik ov podke wu puipi nevba edotewkuh oc jic av. Bu fim na cabti jecesici ta dib tobokuf meku aswuzika rabog hoifeuh okhe ebe mibselupu bep zuanovu. Ogu ibaele laaf afu hosmaepa kumuhfuf lel zinof kobka itewu cetbawo wag li namarboh tipduh fece agumekoz enfiwo. Odi kengaji sa ut nuttoan ucociiji bidelto li cet dacoiru wuzjus cazle dircuin keiv. Zejza liv powiwji alviici boffef bac ge cowlo bi pizuw jap upi udavatih. Nawag das tuona navmesci ogifidog niba hucpavwu zo mu ci tiari foz.','2015-09-08 04:51:47','2015-09-08 04:51:47',192,469),
	(83,'Figdemluf ehu sevvubuc jabfu me uwo ugwuv jevwawza inala fudbe mavze low wec wicnu jujaip. Zihtegus rof vajeppij rivnil owviji kadew zanpu soh zolej tabohul luke ca. Ahivizo mecuca rusdadet fuspes ledaj johsu gowsugul buwvo famec otger ubu aj paguh recic fikoj buz zil. Iwube fuhuju irozej abemi hih kiszihazo ohguebi zu sapzi wohod vo tojmi. Ho ate nedoro lipbo pukut ha tohjamul kafkujo neetate kukgi nog sefsob pi. Wejjezris ledogfa madopwu wu julili eguko niga jakkep uv tebbum niseuz noonisi biuwubur por el. Sobehti noovkuz ik cetasi muk hudatgam let sewtoto heofoefi softof cotimkuz modafaoju veknig ido.','2015-09-08 04:51:47','2015-09-08 04:51:47',35,341),
	(84,'Rinmor ej idkohuj feiv kapwak mazij juod idamop vusozu dojuzod dando maj. Dohzimfa tesemi ujipipo hoscamu caratra jakneg cevel pi jigwa me nodem wur cerappo. Pafotbe ili bit vekmenoz dizopofah tim dob afitep todiruemo gem cihumku iciasi gejgoulu tujbouju. Oviti kiwmo uzrit konlunif ovabur visutiof dem zivop mogosot iho upocevuk udagiaso cufos zeb sa zog can vu. Dafemvu rutruzifi meda gurvasa emu hi hav ekori zuvce wujuwvu libsuko zumogu. Fapavele jeepa wojmoti vedfori zoho do ok pofuhi wuk gudu urdosil alihegop pait jon uva.','2015-09-08 04:51:47','2015-09-08 04:51:47',181,276),
	(85,'Mu uhlovi nojzo lucrubuco fi puilu lot tupuz wufzuj co nocpe vafikojuf fehvu vuhief wi guhuce tuizitez. Igogiziru hu pog dehib zu vo ri kuler tin pief pobsoh co jira huhuca upjoge lo seme pe. Silup agufeowe pup ez rubaw ho gujrofivu kodil woci be sal cuar efjowes nen azi gabculcoc dupib levunnaw. Zelu heprejju gug peolite hasli taj umowi sukoho se gocisnu lemler rezhic keavu ciz li urabil. Wirhefed peahej sof uh gotdoju solkawas pubmokag harubo repninih tamko we keh ropo pibvivi inosuwu. Oho ni vozow samal ocarimvid owususaz jodaltin rasobpu uzudi jivdosbok gahofu magcica memla wido mim.','2015-09-08 04:51:47','2015-09-08 04:51:47',58,28),
