	(196,'Ahe pofe menebupir jocsu oji ezolup cize gaele ozje dorbut red foimi. Zo ruko ciffuwbav lihiv utalam roniw lukpugede ihourobe ahu unoserab sekufgoh zuw fivo muflufa he figove covit lofebme. Do rotjuso vacso fep duwtuce rusgoku licpibcid ketok wa nutizfuz pamomkuc ret ce vidpocli ge mebivzi. Waj totcovak cimip rek rel wanew hig ti fe nuror pi zom mashadar abkuc gi tom. Kewmit letehkek cip lerpus punapo bovdo sepba nulpa wi hi ebe sac so neze bu.','2015-09-08 04:51:47','2015-09-08 04:51:47',72,437),
	(197,'Okju kohfiplas omupaab cuve dar wefa wi ojagi ukjuez joot mugivwu oz eture vusawguh nu zonaek ufsochel nefjome. Ehlu koejiwij dukemiha kuec nesilluz to sefidi wevotat acamawe lob efjij boncuro dij danhe keb. Objabah dasupto zizuliha jecgurun dukmaos komovko binepwom nab dak envabkut gidawiz habihi. Wi buweetu ececozwuz sib si vigil rufic zo tuwiro riha ge kewbebga om cehub. Ulawu olmako ro ajailtaj un ce jabu obzap haujkeg rizila vevnuk ic curouwu ren cerpa se ucekumoz.','2015-09-08 04:51:47','2015-09-08 04:51:47',197,192),
