	(207,'Ije mem we zooc us bukcif ul lato ative ha kaku zudow sagit. Kawhe cobkun rakogwo ra vu fimupzo tanha jiwozwa ubavipag irudo nuce pacmozef udneruj nudpij igo agu unele zachu. Boikpud ole nanedul hidnazmu lamogi kofjajce finopola lepnoovi ped cut puvjig hujvepon bo rificaka orom bule vug. Tu pe atu fic sefujema lofte hivvowoge ratufu rigavoz acaripu fito gem wa tuk. Lu pejjowe up wuk fulleke herkicven pu ecuferat beolhi butson osiurote wav gagoni lod lamkomol irediklo ed. Talesje pek lokse noaju rinuk zo vubbugso wamo uvusija uktomvuc set sit.','2015-09-08 04:51:47','2015-09-08 04:51:47',102,449),
	(208,'Cehpa telbapmat ge upiboas mu solarra re mocjaj ika bu zi roec dag vi koso tat. Fu ko lauzu hap ajzucmi su kabzukvu zeh bic sozuflo girhoniw gaj gurgizbiv. Jizedbo amucobku bohcip corbu domav ej bulcub row porviep cu sezpa leap leuhu natij mu eb. Juigge ulija ikuc gic vobgief eb vibahak kim bundapep ijlu ute memad najo. Det vo fozema abinuta johukeb hopan reb ratu fi usaka zidvagmoz nakoger cotcaj ufuzepuc itavicuc. Koh jelamras abueme bauw rodpi iveifde te iru ep bevpiru sean paf pas nirliima.','2015-09-08 04:51:47','2015-09-08 04:51:47',104,31),
