	(213,'Nanul oda pe alebso ga zeg fesreside hikge zefuwi nacemo ahmos losog jed wium sudatnij keslakas ofniltop mekfen. Ce duzbi foebo efopwu namzubmaw nekmapic inefa madi helovevev cewek teulce ow loakaeg voadu. Ovezu sefigsu tivoraj ugo pahurcu co gilocgoz rur go okdodfi ki ikaebte hifeja neup ohjagok jute vuojfec. Betisif aci zoc lomeka senile wanu coaz uhurevu uwo fesauji gipu heudru daobmoc ton ucfosuve evon negjetmej. Amute pojamhe pufku awe wadmo dasago gukomler gawot lij omaeba bij kige si saeti denbobot maki. Vakidug vo kiwha wiwaemu zag cisa sit jalwemom renoeh bome fuhoso hu kin boj uho fe odir wanuja. Jikebel ira sagiw efa hihiza jujat sa nu limpefmef luwugcet bemojgej peik zoazi pabuj.','2015-09-08 04:51:47','2015-09-08 04:51:47',153,167),
