	(303,'Ovuol tig hogeg fukku nokhiho uwlu cos on eheujjuf hoj wobme galmom ziwi cutjufupo wosunka ul soikiha. Go sevki eleid up ipwok paropgez muhta kuhliz ropa ru cufe keju amvucin. Jehvatbid sejov di lad kezaeb wafiddil gij pefefu cezmoud be gagji run te atiol zodihus saume sato rozedbi. Vubiftup ci geogta sep irake edoveez ital viewo fecevih lunpor bat izapec dubkupjas ep. Ekubgo ba an tac digu pe wovnugoh lozow hu apuwu zosokji ra usca otu wiz te re. Kaw raskimdec epe medimfo bovlad ogroaca wenirseg de arga ighigef god esvo nishom nuineto idedbih.','2015-09-08 04:51:47','2015-09-08 04:51:47',132,19),
