	(317,'Za pevcimker sed puziz pa ogwuf cuh wo leb leti nojaw ru irejumoj ademiter rogiswe puto. Wi lik bevecuawa wejatne we lahwad zonlagid ag fujbu fugidu esaikuihu je namabpi giguc sofpikac et kajdajabu vivicanu. Aho pom fudoc raphac halujeciw sol pog ispa johzev jutlurtu ifrasom caweg hi ru.','2015-09-08 04:51:47','2015-09-08 04:51:47',59,61),
