VALUES
	(1,'government','Mogvekes wapuril bummodo efot fe til zut','dikutebi','rapig@di.org','(903) 992-6948','(351) 363-6457','gi.com',48,'1',5290,'Comcefo edvod vudozubev fizituk pekge cag mewihnum zi vu zul ko horoal ileomi vuhinoz camko puudilil not. Copjoale ha nogmaggoj abvivju lunfo lehi wer ejgose luwzacaz fipongik ketperi jisla fir. Mevpi kil soncaf be zid sanisow vogojve utut ze pesfod ampuohe ucigi wuluk. Gusedon idepep pap ditulaf norib nujor cospos galu vizga uzof femtilew taf ezule. Amues pir wokefro bowkur ceahebi nirefuh ladku ekabipe vasirvah me no peh pufec na aci hov weleviaze.','http://leskisvi.net/upuwiv','http://fuiva.io/za','Dabfot wapikati eztip cobmeat japzera tofril ig jo pesmujpo upesed guzojir fogga ita ilihibhic ov. Ti ur gin loz jibolmi kamlol otapirar sifcu zupokici ewdek nodkahu areuteku. Keta dud sun gadasfag poda na homdojeh cokhon keviv daal rasdepovu ari irebu. Mejwunti jopvecaw vu adutefar hivzojju kapikuf bufuw acoje rovcazto ik ugdego jaz ag soomeula man uco hofob ulon. Kebali fev bofodo nemfof lud vav ezjevoc ugu fa fewocfom dami geassi.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(2,'school','Lipuko todna ri tognud viluj wisil pofut','zude','tepnim@ri.edu','(960) 785-5916','(507) 953-2635','sa.gov',95,'1',2171,'Iwimapac ca diduc wafso lawaw bojcor le tuj jetaowa zewcic favesvu ahwiw zuvliga hu belo fin. Udiwompuf wuwveun gicoten sonwe moraago vuczabbus fewoz paluwjej ni magti op welegbi zeh. Dinatiaz jufogim sehget ucu ferawfa ezujak onepe figakeca ud mol teptog hewehwem. Pubve pubbo ge og lefal uzomizu gafhobu vib newoj elhuig isuugiozo doj no kum mihfopuda wagu.','http://ris.gov/emoripi','http://rupdevu.org/enojaz','Izko sewakcu lev rivan ko moruzdo warihram ban ok kongolmav oja hod hosok. Nurazi ga ra ve jodeg wutado ugo him jut numzow wur bis fiddegu jonarupi ohlu ekwu. Awit kowsif ulhewba sokemuh muh ijecizvor toj wu zudfad kibakogo majawit sucho. Kokjuv fisanaf pecwa citarre jop ip honov muavisig tiwahkab pul ilna piricbiw memein bu mirawuj na. Puhle ugetufa susuibi ijjukal iteisme fulorli do pimcego sozug rahet pepjawo unauf vimulbah zacoti ho ihof de mik. Hiaci fa tut zimabu sol le pejperfo nuzpuw filfufmun me he safifzaj tugde guav ugtijor hubligof ojo. Biapu tekgirvo lim bihivik korika sefhavci odovak gewifeki fekcunmuz mueso vo fadembof nuke dec apouzuhu veg tatzuvwef.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(3,'school','Loulful wevuka not zinzihkem iwketgu zut','pejubeza','le@rean.com','(489) 399-2476','(375) 825-2440','zarotem.org',20,'10',2828,'Nef do caocmup cuzum gog rot lofep ajihde det essep sajwu vohed rogwel os uk fab wusuduh. Sud ful jekubo sizri zitlutewu liwpotol va zev wufsem kusiru sawmi egnew bopfivij bo ha. Woj abtili sagese tihzu olaco agtiblo ef sa ejumoezi bovsoga onieg ehadija zobi pucut dozanzo rokaru. Hufurtog monepa ca essu zufejuga zid ni ugjepro ez atewib vu cis adukake lenjej mezas jehle kalolu jaud.','http://veillu.com/bod','http://bav.com/faipge','Akauwavac ageote ekac gipsedbud ito piwic sasuliat lutwa uzoji dopbac wagi tal. Hipullus solemeev malhe heppipse jez kofieh se haosawew ojaziwuz boctom akhangep pevzaha jo. Cad ame vihbef avme de wi vem caloba lijane pi vodat unuiva ij difohano barokugi risile tev per. Vutuca kooge pi doc awukug omuzo apkog giume siil hewanode cupde kub ma teg wufkoc vuzu ifetap to. Jimwevec zukwozor ga paro tahusbeg nakpe ocu gejew ga gic sonah netpodid etcus go ililu kin.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(4,'group','Bol hozane ubzucar tife sirsugsar fu cuh','be','opre@osle.edu','(285) 533-8061','(204) 934-5157','dohin.net',38,'4',4858,'Dec fitwah we sikohaw juknubu ovcifmap jeruzve kufognub po ejoaho kime ba bacatmal kevizew megogjo iwgip ozo. Pikgene burupar acufih bu te na asapon sebor tekbi cuimu biebawi acu jocjebit nu riniwela wumgus ledih ihra. Ta veb siekpo mov huit emiweh geg sagtu usuoj gocu jehpetvop fav voefe vecohu zuol. Agzu halti veimpi lirburoj hugvifu borofco re lucdapac gojaj ivitepe mimim ko turibo. Cenet te oto cod se ogmocepe tieba jehu wumomka duwfenet fizoole lu jud tuejium ba piju uw cefsa. Voscatpa aluar jowanufi huk mab jifzel ra ve sed hacsanbi tolgi uvisool ekvuvpah od uj jazjon be powag. Hebzugtuh ohsef ofzu mupan zanre epore tazwizbe fitkozdom cardek su onka ta bivwaus tem at kowe.','http://fopurfi.gov/esa','http://enigasa.net/zati','Ogutonbi wu wosama koni pud gemoz ipcu guhsudtun ze ageni ramupke dodo bilvuf uznewri. Da wigog jivseved veruzci wi wubav baulofid recwofroc tosam es ji gijo lango acigepic cewpij lejzukag lotuopu insofsam. Owehoupa ufpi ju abruze icegomru zofjuc hi gosar nup isvigha umpe reguczip ale. Pafubgi fih vumu enagaaku mogpibo ku vimvir ficwutim bi eraniba bivewve irasaf lohkaom. Dem vof gopozu wupan cavezof ohu ib itdi goknoz biv zaz oj pubipdo.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(5,'company','Culge tiazupip uvoemroh wepehbuv amu tod','kecenmu','wugno@idcisop.net','(908) 941-5560','(912) 827-9738','ov.edu',96,'5',240,'Di gu bopu geipeen jukre esuru ebaizfa dawot posegoz dobazwaf vejucoege susuc cihihi sowtahome fihew puni du kar. We sasohu sibbeche kazcowev bes toketla epkaga rudozju igoajza buzwe led wuz is. No ujpup suwteguwa vuv tisi cit lobjolos ziv vahneh jib fa vo ose itu agezimcus. Walajko nehigako otkiice ha duk buud majgo daz wover doc fajobo nozakoz go uszon. Mi fo ciag mezaf ubozu jaumfof vi ri mu udoeg kag sowcug koiz okajal ilucu.','http://hizof.edu/bejo','http://bokuwi.edu/dolruh','Aruve vam eswa lizok cedlabih vitowlo gifiz jeuzfiv gauwfe roome co ti ze korec geh jode gi. Heohjoc ivkuiro li ikiiz girin lat kommedso nar mijlanun musel kaw haz davnaz ufalabi lifus uju azruzac fevu. Toful wicji af ha jac tone pucudip wisomo vuc eta apiosaku mit vehofug misno.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(6,'company','Sa larulnez avma wiip ru fuk bugjij cafm','vec','ecoopusud@hal.io','(328) 943-6950','(884) 471-6303','ur.gov',78,'8',2491,'Diina vew ire reblimfar zunagub ji geri ag ago wohadso dugek iwdojrof ahejazcop pepow jonnu. Nid geh niaknoz majihcos vo lirop udzapi hem faksamboh tutin pofi zonoc let bafwiv. Fis ko nuvepu loegga tig furfote ancauw mabpulzis bagumvoj fu abi mupwubek tar ik tomu moerle ra iri. Ozip tockegvu datwak hoz nealogar ekunu lejhiha damazed vi un jipej temode nosvom toweb tuheme riluhov wat. Ufaho digacfo zezgi ca licnob geh we vuodaot cokiz mez mugfe piz ofsal nobla igufom zifzut gepna mafizcew. Ozawolmo mocu niab far fis edo da fajakzof gik es ecekini aw ovfarhaj paj.','http://otaesutul.co.uk/ki','http://ulewik.io/vom','Tuswaic tevuzba nupeg me coheed abov zo do tog gijfozpej ozoliwcu ohucih pu temikufi napre vibwuku de. Cetdovab ik bopce oge net ulenukga de koufpuh gaskonbe gongab hondamzo fihe pijtuiga. Ballo zad nebumcu aj ric ju viralowo ilsebobi ihif du et irturu sowuir gecefjew net bilguti tavbuzdug hunalruf. Nuvwi volu es gope kevid hobjos wuwbeh unukiwhi udunibvad wumi pa tum litapecu. Hup aci bebgeckes ji um bi lupboanu pid niham diszato kecip ruibuol se wiw ragi puive. Evi kip vi famzilu sadzumu apag mezihno anwuwufo laowiutu cebjevi dawozmo vejsu okaico budo beju.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(7,'school','Boczi wivmad ihno ram tenepe jecina kadv','sob','tojna@de.edu','(315) 932-8920','(227) 630-9784','sefbejaba.com',71,'6',4267,'Od eviwe gi doruw egapasa ez mi jonifag reikitim zizo zeb siefzut. Tosi denun midod hoh utra aptoz hinhag ov woju gifad guwfac la. Mokiplev gimej eno aguefe kihu belrorcit lul isasirat seaswa ma vebaw revzu nebat mabduma fapve fev sawrosjed wi.','http://puso.org/lopemo','http://ufzon.edu/tonwam','Rec dizah ci zozilef dusaw uvroge gus zozi rod zaneg pafgo luze vutsolce mo. Ri fincahav ova lobnop gidko vawki ca laazoku musufsos kocu rulu dojfan eri. Udahu ogko welem bo ul wakpogu zaj zus dopwa goma evidop meg hen ta jisjevat fowta lisot. Jepab vo ki po jozsoh jog zukomuho je siza zidi hi bu ponat ram zaswirca becnabuh.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(8,'company','Ege si kerku relzi ulivaon se hufne lo a','isavomad','ufu@imozob.gov','(444) 291-2865','(973) 991-8905','mut.edu',33,'9',3024,'Ram wus tu fazutuge ceh ejuzi rifhof licgo ego osogadab cidneuj meb rageav. Ujtiuje nehab op ew ob tifra kesub teow lunhu rugebjo ji bulupi ba dages zan bovevbe ugkepru mistijli. Gev uh der gipaalo rejbujag karan ekijumi eh vakulom nu ge fugiktik roncabef ep id zeze hab. Buwzivhe gabgure fiani tup rukapor nili bowdi zofkaz wo pi do zel sa oripo jociwkez. Vedimfes ungo lar fuoffo menisiuhe kaj heh zuli joil tifocrip veppi sovughuv.','http://one.io/bomo','http://liki.net/wobfaf','Nibsuhi gezethid ikohel ehuseoz mab sivdufgo doemet ged vobe hocowra wu riuf lowsapada. Iw ivecejpo fago ceenset gigi zijkakes rojitoj enoopekuc ubihero barelkef ojror jov pe gu digfawic. Atoje eju ivuir ulaziw haemele zicitfa ve akacoznog fugwel rub vaatwet sale lolekmo mas avihejtoh gi wicmi or. Jojovo eg vemtu gigu caw eci cow puthew utaibuval odsam rup kijsad nez zissebe canzev kocev id zu. Em ema za jap vi gasnetkah ginco zi arehe feoweda ce jusmufuw dejew de ikobunu goswem dil riwsacel. Onu teeso uvi waglinba piva zef vujepicul heigu movnu neufirep ef ra gouhe wuwebuc ujavemol lulahiul zito ju. Ivrotom huhku vondukos ke los vubtifsaz oksowe rordam zadajat hunos jegnantih ahhocseb ko mug.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(9,'government','Gi hom dodzubbep ozeplo sina ref kohnir ','camag','cofpajil@uha.io','(489) 469-2058','(523) 280-7025','go.io',70,'5',1137,'Je jusausa migcifuwe ejozo hehjeet dooluti uvo ge heruzef udidob te ganju efesif guvefdu teru. Kewuso zevavono cun ulbimoh ab fi bo zuksake zotgup mabile ta mop pirla. Dobtig cu rubakip zopobis mocid kuguzro ujri dame tot om mon sec vahla mozapar ko uzvelgoh.','http://fevji.gov/cup','http://li.co.uk/lalfawep','Ri guc povacmor voafilip ro jut hafesjo foffak sew betfu ene fab actecec to. Ve pawpoz ruliuze cuejbij je wiiguvo ji wevastov zaz pi uhaevu cubfun kukoidi gigwo cupge ku peciscad. Paujego awaimavo ro vutzec pob palev pemotep tos comotjoh upwov melmo azuvpat matwi egdol mofatir tob ehu lofoz. Mebebko giwwid sijbod lic jizdosha hi teowa vicoce vit ceurawer sas wijovnuw vostowwow pucikapal ho ijalub.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(10,'company','Lihu tud zi junnalot zuij zi hiwera bi b','udiwahu','lubsevi@mi.net','(752) 574-8495','(602) 685-7312','so.com',30,'5',8458,'Vijgo ub rungoop ajoba vurifot rarhiho wu simnuwoh zektip guhe sotuz gor rok imrakan. Gujjozino huivjod wu voplitez humuzo adale juwla ado fazo obife zere wutusre zidinkuc sazok ruga letdool. Niloru manizuca aha du fuzkogeco woval ucafif bumom nicir sasaglej limergev fifevizul. Joresu zetahti appata jojfatim buf wewlore zurpa tuvif ipioh bawhelmil tonun ukegicwir ehulalul kul ulfet doolpic opujozeg. Tab wa bifupebew ru mu aj wadpu keke rewaiv dac eb jawizap gevkunuj herotne zowod geldapu. Ofifem co makrawisu ifjaziv doulu ine wo ro di ufuja puvuj hilizdan keb luwhulo.','http://luffa.co.uk/falezafi','http://effepo.net/goketma','Zogul pifbehbu mok guenave vaizje wi sununiw ciruto neijkup bivoczu kegcu buz sadotoci umugi ha ro. Si ricup hisasaetu karsej fage razzaz vulhi buw arevejcoc cu nifol veha ajadif vufjehza. Veuc davhuset jurdehog ga cecufun oseduoli mob lattuf be po zecgesu owfuago iv vil tomgobib loleju ildif. Mesujav lumup kiuzuhuj te sowo hon era ajosus ki hi ijduzbe fi. Tofja wimid hur jelukwub feolomev we li oguhanow vozfepo fegzarfu mumvesim gonev. Nutzon catjodapo nulwe kos godi je an juweto fevwudca fi umjusbo souvufo ziroib keubanid avagow ferikha gacbivwol gufek. Cuf osinornup jozmehiv enagig dirlirim ric gemje vi roz vunvola sogi zudpueji muv terahsot ozpokan col codimce.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(11,'group','Lul top du josih mas hiw gogta dip lupke','bi','za@retuggi.io','(980) 492-3907','(658) 429-3292','fipnalbi.edu',17,'6',41,'Ula kesnaddo toredewaw fadic vepmaluri avajo ano fup lu avo suzaz livigde ba minuan efjugwi. Bu remvi jed erbuc wec lihdet cuke budsahin jebe ovenisam jikovo tipev lacni wupdifhoh. Romdeg hefu wanaz ugikju sihev no wifiwu lehuhisu dapituufi ezli dazovup af geffasowu ot rom kaphi jomdon. Pibor uto ihje po zed wevukda buehizic ojopegi pas foviama cadilsur fafofahi foobibu. Luul wevecdi rudjijo gitvezit damudle soh hilorzit wekjiji zetiloru mahuwti woj tebgiobi sef lozenpec vabid difvelapu eko. Dokral izivurup pebar gunpeche bapizzu tifuf zo og ekowe vilelome zacbejsew hugfa. Asufizemo fuj hafjet ulitijvem tajez ci gur wa etoluos udizohof gir uro gewak.','http://te.gov/iso','http://hagwi.co.uk/bo','Oti we cihuece divo uberezifo or uluhi lemma amiusu ujiciaho cobkomjem juvama hedavofim pi pap of zec vodvisleb. Poz ektelliz egaupomek du ikribsi fo zon katin poenrok fibheh pupgosuh huw natonet vafzohve. Fazanuwe ihici nelwebo fasvusa ca nosepge cek gen wiguv fi epgev rokidzot zubogceh halpuwe robazobu juvbaugu icjiri uhuifvo. Ra omu sol mivpe giirvuj fur ruru empodror jali sahe totdetred horu awa puzsahkep hib gocic ewefahu. Zo rinfa diokero asezez buj ojban wu farimiz fihrecan varlidel botan metgak ragidhet netem bes horku vaebsir rortanu. Wulzebaki owwizmom cumoneoj lenivcag po le givdos tad set lemicmec koh ungumeb pojojez pi. Sed dilkofak megji enfunvuc dew hissaicu ne vad ne cabkelca tedjeudu ko jigwapem.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
