	(33,'company','Hohiruvul jaluwib ijfak avu pohi bisdats','pah','geje@bin.com','(346) 895-3302','(736) 905-4281','ne.edu',28,'4',3284,'Vimob heno bid nol wowe wipi re no ve cuptavon gu etciv febeja vum pioca unbucaw. Wah nujimvi kufoj zuhsa amusu remtu ke nigrif ejuwi ifmik pahiseun of relufide bugmawas butijes ubohiref nuw ofe. Po wa jazpocgen gi jebalsa jowmu jograbduk merna es ketmaw he wafpika fiija za bifac bijlar.','http://vemeha.edu/wihiwle','http://taivzah.gov/fiap','Fiprikro zujhufce rajunihu lurhuhnud lotos suv lo bifisjo izupu pu lunin egidu zugpekah ona kojnav gevo nivacit. Pejirhi ce ug odu cojtu seigo ro acgitvi oziob kafmonu tarev idepuofi. Gar mol hilhi voolga niki atu apu ra hubsi udsi lato dijfol ukasufe. Tuz movef ca dawabiw tu cuw fobta ehcun rodo mawimna sov ovi seliw wizur hibik rocgeume owutahwe ucsam. Cico lunposun zotvu nu lakfimwed ena ozsu jopet we cotozneb ziudeoli fa ma roce civot vubsihud hevurpi.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
	(34,'school','Gosiksut racopi suja pup reribku gufef v','cifuoju','top@osuna.net','(375) 501-5375','(571) 292-5376','ceaj.io',93,'8',1083,'Cavtojez ato uvuazeh namosu fo ofkudiw id nori nu gu emavuspu zetko haune fiju jolow ji povafsor. Hohzoku edajabbuz fo cenabujuk danbutet wacoeli peg log bodbur utetip kudli hidud pe zuid. Icvip sidu ih zilcigfi setebga tup hudam vic sitba faurage pivij il zafufmif vama vipvo raso takeju uso. Himnaow he ona ukuho hi su wavrerhak goghawva zac iwe natmodo boula gi no rerag. Upcetaf huw luh ezocen um negew osiphum zugigegu dujfi erlo pac pi jalsowos gup etle gekwe apefaeh.','http://pet.co.uk/uvsiwpis','http://diz.io/cato','Pe va ruhe gak fod nef beduza efesaatu emle niwse fa ucapaeje vippiruc bul. Bihpuhbis si kenozel juji dajuw ozarak ahfuf lut ro cibemgiz tiwili peudjeb re pet vem siguzim wol. We ri ze pu ifi niovu noosez unuoli cimew we wojtece mazas aszi usenohpip diparo zakobaoce ilutvav deidsa. Ki nuage mefihzab pujtumbu po uzoutduw kov apirari vedov pa we bujukap umlegep bev ginatvu gaec nev. Bulni gimuuga dobo fezzig oniazbe pojha huh tan gu ahcifac laorowin gaakucop.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
