	(38,'company','Ajco sohijmis igi cezcarav gu zouw lalbu','fe','noireuz@ladad.org','(254) 532-8518','(225) 598-1745','wico.co.uk',85,'5',4387,'Lir ikeej serimi vuken veh sopfawu elasaspa kepilzan pulfophob izfilem gul omlaro os ohi fulobi luwozu je. Alisavsoh hup rizo ikeripah baazamab bozem sewvujhog emweb vekad ihfize zaiktiw eza pid oceleva. Gi wirwi ugizit he fefru tafe awe owo ma ico meblemho ob webvuev er. Ke urop utohudde raazagur ogpivga fubul wuzcerem fuomi atioco venu potnafe dilzaf binulo dirdis fobgu fiwde. Dojlo hijcu rowdug dev mafet vemipe ruzeofi tih hueknel ivufi gu wup vu kaf.','http://pagilvod.io/avuwat','http://lioveni.co.uk/zatbo','Obuco den mosev idabe ciciv pocojfa adwi totoza duc gugapev widgo kirho pejwa hoplakuf. Kuwhoku ejtodit mewgub ivgul sosav ran re cad nazoj ekvot tu pedudazuz ju. Usupufni uda deguos nigos hun esjoksev lok ap huipmi wogsi soh nik. Agaceb dani hatgem esa edolu saholipi kal ez ho detawdos udsibo ruvkap. Cu hikbafto votim zet zovpupe po jevudcod en zuajuruh woted vaw fimanga wemgoviwo vidci jitzozu zovozu oshic ditowsac. Har re hig vukushep ji lesbidas hevi wa tepi vul asvages zike lokoru pihuv wuz cec. Vovo ef sedu ju uhracum gugih moimra rujuh din ih cidus besleire tacoz mifawevi zuw ur zegaz lobkev.','2015-09-08 04:51:08','2015-09-08 04:51:08'),
