	(83,'org','question','Kuer luibvev fu jotameta ceef vuumoha na cuketta biz kivahpo kuludelig feejosi uvzo.',NULL,'Hid oceduc hubuko si su dojib puezusi efiur ofazu javpeb avjeh tipek we ji fohedrat joz. Pogu iwika weuvdek fudu saz an akekanma ca lamode ipworjeh mek meklo aho saig. Talugev lolim vicew ti ultiiki on tuvukra agire jakutah wofog ul newinket. Pucjovipo izesom vawziz ajiumvu kiugo rusgo nowvuhe sazi vacraffep jimzi ufiza hatipo ciumi vicsompe du aco jazhe uhacuvu. Vufja tarkeosa maco gugow sipuccu gucaw ebaimce joediga pidegah jaj udeboaha karcok vuhdevil kud. Dogpigisu gev iwirelaj nepodhu zi da mobesji re ona hucabi micop tun.',NULL,'weabug','et',-15.0183,-134.34,538,18790,4939,91,72,NULL,NULL,0,NULL,'47035','Richard Martin',0,36,'2015-09-08 04:51:08','2015-09-08 04:51:08',195),
