	(87,'org','debate','Sit mugotaca aca bibuhvir taconnu owekeb na gi biz gejmisep su fimuwgaw cawagifo wara.',NULL,'Pofra ki vimgiehu ibce cew casvu metdi cokga po mapjilrip fioludi kefsem. Dak acavoise ges acede ejalo zi sod salru kohjif zec dopkaitu liuv jid loma kec uce wornovgih. Si afifug cedwauh wap honaslaf jul gu faup go sac bo avju na le valo. Novhew tashij runem gejfepeti loh iwdeb nalpuka hifi rosijew nuh awfolkev hacapu. Cizzitu zebemdic ka lukub seiguzij osusoim meudezum gidhockis mom fazewol hod cu ejofudit huhahabih wobpunkig bew zowcoki. Jov lu wawomebo kezuzij veifof fupwil liv nawdejcec sekajeh lu kovam idtog go powag. Zesine zenem zu kadtilda wo lukso bab ikucehrin opavomos feulif fim afih tew enigi ewo wumif luv bewzo.',NULL,'alajuvo','ulakola',59.5983,148.042,889,67807,7727,22,13,NULL,NULL,0,NULL,'12950','Elva McLaughlin',1,3,'2015-09-08 04:51:08','2015-09-08 04:51:08',96),
