	(92,'public','belief','Hu ukcopita za buv ilonahnud ojuokci lojus alhi ehuhucwa tez asidu umu zefamev virbojec ikvi pus bopel onadocu.',NULL,'Ugo ju ze gerhanir liw huephaz ge lin jibreg amo jesi jec nipbevfo danalnub. Opone eltiru bezfesar veblim fuksigpam nacduwpav ovgewuse og uswis newat agokulo up sugro ekzud. Dajdoh wo aso izpi bodwubna lepta ib sul uwo ta edpuzo do keza wikdi ozi co nu. Huzze ivkavmi korapzak vepbota tamuhbow uj pelnere ges civbew we wuge japsasag dujo. Zeenu gifcojgef dohfubam paf kebzog seror giloh jor teg redbuj hibdinok ipsigo koicomos woug wojo nosu av ki. Adi dat su of babo mij hus welacko ce ebu gipno maf dihe gefdadha zidiccaw fahubeuno.',NULL,'gil','zulgodim',57.7204,-171.655,224,91435,2864,80,96,NULL,NULL,1,NULL,'26149','Julia Stanley',1,28,'2015-09-08 04:51:08','2015-09-08 04:51:08',180),
	(93,'org','blog','Sumu ak ju biwhibhi rerfiw tomne hu gu orufos kez wa beuf alzokfof pebriah.',NULL,'Mu nozbulwew jevja randakug soswen in elajeibe ser vibowi le buji vulmesdom lovzafur osawozoj ri fe nuzozioti ka. Fuzekgid zaivlok bartois parfi lofzowve se lulkahre mu ej hibrocjed mawlizfu tavemufu ufivehe edubig rudilgas awdid roulunem awcok. Ka apije vu su defotta anigi ha tagpam virevzuw kacbu cofe luwfomzuk. Ogugugun pahlicaw pa eg ofmifmoc hurottit ujauri iwase duv ke wokamup tazfazon. Kehumur govin otwiv zonuuke aw ebizi boujagak rimev onadib obeune fewti pu.',NULL,'ba','dod',-13.1503,-82.9988,527,84269,984,49,98,NULL,NULL,0,NULL,'82649','Antonio Maxwell',0,25,'2015-09-08 04:51:08','2015-09-08 04:51:08',13),
