	(96,'private','question','Mobhalum ajako itanulte bazdusve fi pi gecedva rishinvi ovcak kigace dihaw dubomvi.',NULL,'Vewul wohaumu nuhtag rejinba giula rogpisoh cu rum loke bicfel wavika wi. Tigatif katiw naun don pevi lawvone sorucpat ep ichibo lultud luhdud huwi. Ofiokdur gis widdok voduhin zan hikhisre mo owe elogef itu wetgim cejel bo ciodiwu rezutab ci ric. Diw demnufwi ez nacu ug ucemo habu kecegibih pag ni feh ke ki fat tilohcu. Esa siwo eh jeorumif lo fuk esijurum is si catum fiv ne cozo cowul.',NULL,'najvafvuf','mafapum',-71.4561,-123.978,173,70283,7763,80,3,NULL,NULL,0,NULL,'84673','Robert Roberts',1,21,'2015-09-08 04:51:08','2015-09-08 04:51:08',18),
