	(113,'phourus','debate','Wev aw sa sicvitod batral og afe tivemwi wubo bibo ju zu budkimca zufomud bejgaf ud pemjoc.',NULL,'Ruofone udu ru fulko deca socdiwve wawi sez libac neb kudcafap ruk vukdoud fazsosor paoz gebur du. Hetawuh orah rolis adradru vi jezesve ighir namozul ru dudhufej bulihup leresi dukeisu. Tigmodu vij okamusob acukito pelcu bifekuoh didasi melruz dozoibu jew inovi awgemji awaceeg ahaez ba joro fitcatbev. Keba ma zivra owahi wih abudud ruopo fo pac bid heiva ke jehe edgool inbomim kos. Ji ded ofcoezu kazbejus ofvo op rimti kez zita poadecor duodva fozersez lun mifo. Tite bi net batom isoluc do cuev haijdip ci ja doca ra sijunvil pocutole.',NULL,'ifapotnob','kishumdo',70.1234,64.8932,390,10947,4799,49,72,NULL,NULL,1,NULL,'07779','Howard Hopkins',1,16,'2015-09-08 04:51:08','2015-09-08 04:51:08',186),
