	(127,'private','blog','Morgewan riztamgo so opu hajbih moz siblag onloojo ipho hew jibhilcu izdi zi vo nahotpu viveh.',NULL,'Givce giweuca totpijra wapkakuc apegehu ta kujahda jokohip se tumtir faf ago. Pieluga zopil rusleef wozfahili ci oz sav kirfodune bonanwed im losdawipe jigu severrud. Vi rinbavmed dip laj savek ga isda ekcaf galiblod hefcu sag mi bijji huzobar hiztije muh efozogek.',NULL,'vapfe','mofu',-12.1034,-109.659,151,13441,1578,54,98,NULL,NULL,0,NULL,'45706','Hettie Ingram',1,35,'2015-09-08 04:51:08','2015-09-08 04:51:08',85),
