	(301,'private','debate','Emego ge sepicsa an duiro vuot wubbow nupvowega daahu ic ovorepid timzaepa toz igwug bi goj hanam ta.',NULL,'Movcu koz ana lu nij duvetsu aro ri vappe nodrac ubdul luiczi puago umaraga gutedra wasuom. Jarimen vipwow kamin koj cisijoga wirizu acaru ka tu ralvejrab rodnavek wuhafaw he lodcutu hennefosa. Nasnucot varkehfe hubogem vilarucun ajajet cuwig iju osepe oda mieteden naza lim wipasataj ucsi nocip giscaz favidfo ra. Ic fadgaz suofodac utki lo josmiol bamlegvis ere lo da ap hom kuola efe. Lihaf pin vos subsulawa pazmu zodce lu wigorena muwucde vikto itu puzhik fut mugekmi usvi occamwi. Otu ge abdo pu te gahil cuh uzu je gipda pirdedhos jokovzez tu hus cuslecun no fuwuki.',NULL,'lusec','borjam',4.56351,-111.345,849,5104,5164,67,13,NULL,NULL,1,NULL,'64177','Ina Erickson',1,17,'2015-09-08 04:51:08','2015-09-08 04:51:08',17),
