	(309,'org','debate','Jogwuk avihup susgi cagu wewit dajvo ralwusra kov foj lidujku gonaobo ajzek uho tohbob fatize al zag esoka.',NULL,'Car od ebmotsa kugkil muiw huldaw ib oj mamsopun dudelepa ijuwari foza. Cod ha uja udzu pivi uli nivso fuc pe jem fagovpuf subfa cobi ozevizva ennekat lu. Lokos hewhe cuwo lucwuuh vevis pabwi na lan so mu saj pe doeru ag velgip. Wiwcafto hufna ba secse fo zip imezingen liboz cih tuhtozta faji eke. Cus ru ze getba fenjave zodwuvas cu foujadi zov ra jevolpe uk tanug wi.',NULL,'kuvmu','becdeifu',-0.67587,-94.1747,839,72477,3681,81,18,NULL,NULL,1,NULL,'81716','Johnny Shelton',1,45,'2015-09-08 04:51:08','2015-09-08 04:51:08',126),
	(310,'private','question','Jin nipaseela mideser labi be bekovi ucpadu paew vas izzaip ezubifa saejo rohik gicmiog segtu.',NULL,'Iferaz azzukpo ficpa akaf kete moju jin kog ra fut tu uh haohe. Kuogapad utaej ifu me gibzu vefru pucfolu va ujujubep hokji geape ij ewzobce ziji zabor pi empuf. Zuzveda pu cafejo bos te riditno ra ijinajuk duc co babah jesgu hezaleg agnuti ripboboc. Ovi vuznu pizubej medge to jab fegos jori tud telub giwsaw wunituj rab. Picum gamves gevwoke ku imautga javvaw samija jimrut fo zasal koeka boipveh ewinit valkos wa utluk. Mu appeldat hohifbef ca monca ve bector guv epofo kor misluf juzzuccok ko pipce kec curer. Jamfe di lesweg vired opalawo riracuvu epukuta pihed mudok lumvo wodaj durwijaj.',NULL,'ta','jurubi',75.6675,-120.635,389,85619,8918,100,95,NULL,NULL,0,NULL,'27025','Nancy Hoffman',0,1,'2015-09-08 04:51:08','2015-09-08 04:51:08',186),
	(311,'org','belief','Gu reguhtab wijeewu hiputad geutzu zumkarfac sor abujevit su podokidu bivak ulte wuz lenwam ke nelcihzoc.',NULL,'Zifos rion feleri con olofimsur as nab ga nanpok ru lep delpus sihko oruegi bev. Oma mi ulsegup eveud zuvi en unizufsez odede canima nobupem mu hoigo vuilo he. Asi ca ta maoj diok debelu cer wurpo fes kok cechiz ekahuh dajlo amilid bigtuzmow bumbokfo juuh. Koponpo bivcoha hu vehifobof wenik jimhad soghofop idpahhe boc can giic zizcehjud. Gudedveb uma is sipapse huw te fa tu ka avukibuk eguime wimesum cekucuj ca ce. Gefcejtu reaz coprit conarpaf ejsi epceb midzo ejaj izewon fam jigpida odi naozsad pawuvne.',NULL,'ok','ci',51.5259,-116.847,323,54158,2610,53,5,NULL,NULL,0,NULL,'98073','Ina McCarthy',1,38,'2015-09-08 04:51:08','2015-09-08 04:51:08',119),
	(312,'org','question','Wacsu ik muboscu ori kewbuij difwezo mu betuuc cimuot wac vis latazil juzti haz reesa isoopwo zadlolu.',NULL,'Mal nemiw betuure hirco sisvil tuf na guz vo dezepbi gitonuz di pebbupok sojon. Juuwza fujubnam liohiobu novjavub lomgihi leco ricnevaba no vot diopcep tedre dij ilomiznir suk. Zoeje picav bukotfas porut bakuksec du guv da hugsioc gipraawo hehurgo omaberde nacahsan issa daedo ahlo wifka. Jezu sefwojba ha zarudod cifke zioc ibuticvi wozlef fefvuh wo vate olcomu atcekiv ud toftu.',NULL,'tuk','ri',19.9934,-92.144,167,25046,7699,26,71,NULL,NULL,1,NULL,'81308','Antonio Scott',1,3,'2015-09-08 04:51:08','2015-09-08 04:51:08',135),
