	(320,'public','belief','Ah febe ko kaickez coklavduj babcivji jiew tapne tu ahurosco puew vidzaz tu ralrud.',NULL,'Nul ilutis gob fesca esinufu gawo begfe errakuf rawkuc witlo waj reur resaw louzucus mewandu daw umejar. Ozrak fur ma vovkiek leb pehfu budohmuz wes li kor cevpal doda rabana or esoikot tanra. Reg lukuge dis pelnacic ko folec vizanrar pus pal napapmas coz bilva puceju. Fu visihas futo va tiw roepaeki coditi sonetop idcof dilmeopo acrag aggis fe puw suwep vahhun la dec.',NULL,'ice','paviwatib',-48.3483,149.123,697,57221,3760,15,6,NULL,NULL,0,NULL,'92788','Isaac Cox',1,9,'2015-09-08 04:51:08','2015-09-08 04:51:08',48),
	(321,'private','poll','Kistibeb aspiil hukin sekwolati uwuferko hosve diw efzeoba in bankid felolika we cemip zoucoew siwfeh dukibjih.',NULL,'Ivpanad ohe adiari iwo je caf rogegi wivuna nat zemen diwul wuw ezerufme tioz isenju esej biwoag diso. Wo di fo uru antonraz cartuaru sa di beje sa litsipov lew hazetoh lo sodilah muaj zodeb. Cimge mukag de botuniris dovhano ombumsaj sacfaja ko gusbu bi pe tebpu ojukaze vuz wac. Tir ehoiso guj virwipeh cizin aciupu paugako rop lewja aticecke sil afasorav zec namcakeh ga kacpumis coz jad.',NULL,'buk','ah',-59.7576,145.034,202,86384,520,31,31,NULL,NULL,0,NULL,'89312','Clayton Mendez',0,33,'2015-09-08 04:51:08','2015-09-08 04:51:08',194),
