	(329,'public','question','Hat wocarbi oljurot gizezi juchi na radtirdiv dujkipi miwi jatorij ki hokozobe cejuz.',NULL,'Ilawum dazuvu hezis teclezdot sow hida bavhunew eno haloza wigwe dovjili kufle. Le siitru upabu guliv epo bavo ognotec usjelad wa datjekse abodivoz vez. Hos co zivwik herpi nif cusa hocekli taba suw der ajafejle etjupar hisvaoza neca. Didotada hidcewhi gur kuh zi vuguwe acdiofo uh ef parif uj omase aco ehodo viluc uljoine uvuco. Ekput ebavec javkuoz widu jizi hatevaz oso litfoh pinguf fi bokuwok nis bot ma paga buvdi pezhupuk pevo. Wacfim ladjo zugzol va ag tanko nagagzef ofahew owcanjem vigip ocseslud fidu ewjavhak gevzuab.',NULL,'wiv','pit',-78.7669,-155.009,830,86093,4571,18,94,NULL,NULL,0,NULL,'01530','Lydia Morton',0,13,'2015-09-08 04:51:08','2015-09-08 04:51:08',68),
