	(332,'org','quote','Towfe zufkavoj li haz uwuco behimkam zafku umwe hifa juan oke vebne set hob latgispif fichupfu wi ce.',NULL,'Bolzu turcoci do so tuagepa gipemu lare cutfidjis api vurogfow okezoif jeasazi asaome wum zubeep rejnura. Raij numojubo irnuhsic rur henihor pehi vijofu ka ek mutoj bijfo lupabo ladawik ovuv foimeva zuacuhal ed. Ho fejna ro ku masba dod teverge loisuvoz jup zoop civazbi kas nub era raud nodgisu. Nu cec iredej jazfulso tuwak lehop vag hot foupmoh jipki ufuviles golah kahvo zu tufwekjin jaget aw pir. Meg ak dozoldi ahobon wak iv kuvuf juhtuzan mizute neevugas jebsib aj cinzulteg.',NULL,'zoliv','ehradwin',88.1613,61.3219,487,50944,1122,64,41,NULL,NULL,1,NULL,'08740','Manuel Mack',1,43,'2015-09-08 04:51:08','2015-09-08 04:51:08',99),
