	(425,'public','quote','Degudina pu wivhu zuwehafo pascuku mifgo tipakil taze pihiwiw zidoh gobnu ohziko abi.',NULL,'Omfumi hochofo ew un cut tawa ufvifbu ivvunme agitenfag kase tezo gokhut situ rivfekcut garale cabif. Hibid ohevakfan ur cikwumo ulasuscuh bepubge oc mibef vohve vuwcim junih kifsipim dokra ja bafun. Rezor fapi aco me zeteug vodeg bu be juv gula du ese sa kodjej ma cehon. Logualo ibcaape mibuk otedihrel koodu gehisred va uragig ne zet celo we ze zibmu mafwajew. Nigeg gaekabuj vopovuv vutzan sef oseunese gar rorhotub rec lobic wefa wib ulwopej faipopu.',NULL,'cedja','ejefumoj',-11.6377,5.00236,767,99244,3434,83,75,NULL,NULL,1,NULL,'90894','Hester Elliott',0,42,'2015-09-08 04:51:08','2015-09-08 04:51:08',119),
