	(427,'org','quote','Du hus edoja tedonin lendunsog firi av el jomecgo eceruf geb hoaga cuf.',NULL,'Lutetok ede kotnaope sulholu bubdiz buej eniwe doafiik jigzepi neznorej haale uk. Jebavu zuwnus ini to kubku zewini lavo uhiruw pazhe hobvuku le zadleclub wucop keeghab. Calbizper burwe tabut osejitu wakbi fokek ub puvti me rabi uhiseb atiijane suokauci ji fero likuj anvujove odwoeki. Usuzo negaud iwlen fubde ehu can ace faega nogo do kepu kaw. Culav sapin zijti fav vivko apure paptul ufiziv ulunosat pumpo sacpap vo. He fuw vevo jafa fa jaowda luzged animo uvisu ju ted hi ubnem hut ra pin pofewnol udeadhof.',NULL,'ciri','uca',-1.88953,6.39531,715,94168,482,1,91,NULL,NULL,1,NULL,'61150','Marcus Sims',0,2,'2015-09-08 04:51:08','2015-09-08 04:51:08',77),
	(428,'private','debate','Omane ku waitaki liuju vimod lo ikehuga puga fopucihut suisi kavin timitde hocohka.',NULL,'Awu nuto ril hilatub howvew bu japapa par so za pag maffep uhnul ta. Aduafato pemu ruv sikrecic zozu kaz odaugu aga li bonauti he nurabmog ico cuurguv ejcuk zigiwa obipa. Ruh piz jizrek bi pimvir ace fese uc helor nozewam pu mawmihu new pah sikca muuji biw. Ebo wob ihe ukso ociplom vuwabwiv gagcirse ko opevedos buvlak omuam zid co olo ocawivsu rezporo otoog iho. Citvul jokoaw leefe ilagheb ceihid ota bimo me kizohi sufasu dinni sa nov. Kidaar jip jopja ubu iko dozom biulvuf iszutmev laoneri fu huflet ko ekaacubo zeworik.',NULL,'fungir','ki',11.88,-168.91,503,72714,8432,15,51,NULL,NULL,0,NULL,'90308','Jim Gregory',1,8,'2015-09-08 04:51:08','2015-09-08 04:51:08',131),
